import React from 'react';

import './styles.css';
import sairIcon from '../../assets/images/icons/sair.svg';

function Home(){
    return(
        <div id="page-home">
            <div id="page-home-content" className="container">
                <div className="user-info">
                    <img src={sairIcon} alt="Foto do Usuário"/>
                    <p>username</p>
                </div>
            </div>
        </div>
    )
}

export default Home;
